import React from "react";
import { pages } from "../constant/pages";

const Sidebar = () => {
  return (
    <nav className="z-10 relative rounded-l bg-cyan h-[400px] w-[100px]">
      <ul>
        {pages.map((item) => {
          return (
            <li>
              <div className="-900 h-[50%] w-[100%]">{item.route} </div>
            </li>
          );
        })}
      </ul>
    </nav>
  );
};

export default Sidebar;
